import { useState } from 'react'
import { Container } from "./styles"

interface TimeButtonProps {
  entry: string;
  break1: string;
  break2: string;
  exit: string;
  status: number;
}

export function TimeButton({entry, break1, break2, exit}:TimeButtonProps) {
  const [status, setStatus] = useState(0)

  function handleButtonName(){
    setStatus(status + 1)
  }

  return(
    <Container>
      {(status === 0) &&
      <button onClick={handleButtonName}>|Entry Time</button>}

      {(status === 1) &&
      <button onClick={handleButtonName}>Launch Break</button>}

    </Container>
  );
}
